package test

import (
	"testing"
	"two-pointers/solutions"
)

func TestIsSubsequence(t *testing.T) {
	type args struct {
		s string
		t string
	}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{
			name: "abc",
			args: args{
				s: "abc",
				t: "ahbgdc",
			},
			want: true,
		},
		{
			name: "abc",
			args: args{
				s: "abc",
				t: "ahcgdb",
			},
			want: false,
		},
		{
			name: "axc",
			args: args{
				s: "axc",
				t: "ahbgdc",
			},
			want: false,
		},
		{
			name: "aaaaaa",
			args: args{
				s: "aaaaaa",
				t: "bbaaaa",
			},
			want: false,
		},
		{
			name: "aaaaaa2",
			args: args{
				s: "leeeeetcode",
				t: "\"\"",
			},
			want: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := solutions.IsSubsequence(tt.args.s, tt.args.t); got != tt.want {
				t.Errorf("IsSubsequence() = %v, want %v", got, tt.want)
			}
		})
	}
}
